import React from "react";
import Cards from "./Cards";

const CardList = ({ robots }) => {
  const cardsArray = robots.map((robot, i) => {
    return (
      <Cards
        key={i}
        id={robot[i].id}
        name={robot[i].name}
        email={robot[i].email}
      />
    );
  });
  return <div>{cardsArray}</div>;
};

export default CardList;
